import React, { useState, memo } from 'react'
import  { Box, Grid, Paper } from '@mui/material'
import { BaseGraph } from './BaseGraph';
import { defaultGraphScheme } from '../tools/graphtools';


export const HomeGraph = () => {
    console.log('enter - HomeGraph')

    return (
        <Box bgcolor='primaray.second'>
        <Grid container sx={{m:0.5, width:'95%'}} rowSpacing={1} columnSpacing={1.5}>
            <Grid item xs={4} >
                <Paper 
                    elevation={4}         
                    sx={{ 
                        display: 'flex',
                        margin: '2px',
                        width:'100%',
                        height: '100%',
                        color: 'white',
                    }}
                >
                    {/* <BaseGraph 
                        drawerOpen={false}
                        name={'gene'}
                        genes={['BRCA1','BRCA2']}
                        organs={[]}
                        syndromes={[]}
                        diseases={[]}
                        finalVerdict='Confimred'
                        graphScheme={defaultGraphScheme}
                    /> */}
                </Paper>
            </Grid>
            <Grid item xs={4} >
                <Paper 
                    elevation={4}         
                    sx={{ 
                        display: 'flex',
                        margin: '2px',
                        width:'100%',
                        height: '100%',
                        color: 'white',
                    }}
                >
                    <BaseGraph 
                        drawerOpen={false}
                        name={'organ'}
                        genes={['BRCA1','BRCA2']}
                        organs={[]}
                        syndromes={[]}
                        diseases={[]}
                        finalVerdict='Confimred'
                        graphScheme={defaultGraphScheme}
                    />
                </Paper>
            </Grid>
            <Grid item xs={4} >
                <Paper 
                    elevation={4}         
                    sx={{ 
                        display: 'flex',
                        margin: '2px',
                        width:'100%',
                        height: '100%',
                        color: 'white',
                    }}
                >
                    <BaseGraph 
                        drawerOpen={false}
                        name={'syndome-organ'}
                        genes={['BRCA1','BRCA2']}
                        organs={[]}
                        syndromes={[]}
                        diseases={[]}
                        finalVerdict='Confimred'
                        graphScheme={defaultGraphScheme}
                    />
                </Paper>
            </Grid>
        </Grid>
        </Box>
    )
}
